import { useParams } from 'react-router'
import useFetch from '../services/UserService'

function DevTodayScore() {
    const { id } = useParams()
    const { userData, isLoaded } = useFetch(id)
    return (
        <>
            <main className="h-screen flex flex-col justify-center items-center p-10">
                <p>{isLoaded && `Prénom : ${userData.firstName}`}</p>
                <p>{isLoaded && `Nom : ${userData.lastName}`}</p>
                <p>{isLoaded && `Age : ${userData.age}`}</p>
            </main>
        </>
    )
}

export default DevTodayScore
